import React from 'react'

const HoursBar = props => {


    return(
        <ul>
            {props.hours.map((hour, index) => {
                return <li
                        key={hour.dt}

                       >
                            {new Date(hour.dt * 1000).getHours()} : 00
                       </li>
            })}
        </ul>
    )
}

export default HoursBar
